import React, { Fragment } from "react";
import { useParams } from "react-router-dom";
import { data } from "../data/data";

export const NewPage = () => {
  const { id } = useParams();
  return (
    <Fragment>
    <div>
    {
      data.map((item) => <div>
        <img src={item.img} alt={item.title} />
      </div>)
    }
    {data.map((item) => item.id == id && <p className="card__description" key={id}>{item.description}</p>)}
    </div>
    <div className="card">
      {data.map((item) => item.id == id && item.datas.map((a) => <div className="card__item" key={a.id}>
          <a className="card__link" href={`${a.link}`}>{a.title}</a>
        </div>))}
    </div>
    </Fragment>
  );
};
